func minimumOperations(num string) int {
    minOp := len(num)
    lastPos := [10]int{}
    for i := range lastPos {
        lastPos[i] = -1
    }
    for i := len(num) - 1; i >= 0; i-- {
        digit := num[i] - '0'
        lastPos[digit] = i
        if digit == 0 || digit == 5 {
            for j := 0; j < 10; j++ {
                if (digit == 0 && j%2 == 0 || digit == 5 && (j == 2 || j == 7)) && lastPos[j] != -1 {
                    minOp = min(minOp, len(num)-min(i, lastPos[j])-2)
                }
            }
        }
    }
    if lastPos[0] != -1 && lastPos[0] != len(num)-1 {
        minOp = min(minOp, len(num)-lastPos[0]-2)
    }
    return minOp
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}
